import React from "react";
import { useNavigate } from "react-router-dom";

const Dashboard = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    alert("Logged out successfully!");
    navigate("/login"); // Redirect to login page after logout
  };

  const handleAddExpense = () => {
    // Navigate to AddExpense page
    navigate("/add-expense"); // Adjust the route as needed
  };

  const handleExpenseList = () => {
    // Navigate to ExpenseList page
    navigate("/expense-list"); // Adjust the route as needed
  };

  return (
    <div className="dashboard">
      <h2>Welcome to the Dashboard!</h2>
      <button onClick={handleLogout}>Logout</button>
      <button onClick={handleAddExpense}>Add Expense</button>
      <button onClick={handleExpenseList}>Expense List</button> {/* New Expense List button */}
    </div>
  );
};

export default Dashboard;
